import React from "react";
// import { Link } from "react-router-dom";
import './Nav.css';
function Nav(){
    return(
        <div className="navbar">
            <h1 id="logo">AMUINSIGHT</h1>
            <div className="btns">
                {/* <Link to='/singin'> */}
                    <button className='usernamebtn' color="red">LogIn</button>
                {/* </Link> */}
                {/* <Link to='/singup'> */}
                    <button className='usernamebtn'>SignUp</button> 
                {/* </Link>  */}
            </div>
        </div>
    );
}
export default Nav;
